function Header({ titulo, setPagina, setTitulo, setFiltro, setIcone }) {


  function paginaPerfil() {
    setPagina("perfil");
    setTitulo("Perfil");
    setFiltro("perfil");
    setIcone("perfil");
  }

  return (
    <div className='header'>
      <h2>Gerenciador do {titulo}</h2>
      <div>
        <img className='foto' onClick={paginaPerfil} />
      </div>
    </div>
  );
}

export default Header;
